import React from 'react'

const Login = () => {
  return (
    <div>
      <h2>Login Page</h2>
      <Form.Group className="mb-3">
        <Form.Check type="checkbox" label="Check me out" />
      </Form.Group>
    </div>
  )
}

export default Login
